--
-- Name: v_modele_annonce; Type: VIEW; Schema: public; Owner: your_username
--

CREATE VIEW public.v_modele_annonce AS
 SELECT DISTINCT a.id_annonce,
    dm.id_modele,
    m.nom AS modele_nom,
    mq.nom AS marque_nom,
    mq.id_marque,
    a.date_annonce
   FROM (((public.annonce a
     JOIN public.details_modele dm ON (((a.id_annonce)::text = (dm.id_annonce)::text)))
     JOIN public.modele m ON (((dm.id_modele)::text = (m.id_modele)::text)))
     JOIN public.marque mq ON (((m.id_marque)::text = (mq.id_marque)::text)));


ALTER VIEW public.v_modele_annonce OWNER TO your_username;

--
-- Name: v_nombre_annonce_par_mois_par_annee; Type: VIEW; Schema: public; Owner: your_username
--

CREATE VIEW public.v_nombre_annonce_par_mois_par_annee AS
 SELECT count(a.id_annonce) AS nombre,
    m.id_mois,
    m.nom,
    EXTRACT(year FROM a.date_annonce) AS "extract",
    a.etat
   FROM (public.mois m
     LEFT JOIN public.annonce a ON (((m.id_mois)::numeric = EXTRACT(month FROM a.date_annonce))))
  GROUP BY m.id_mois, m.nom, (EXTRACT(year FROM a.date_annonce)), a.etat;


ALTER VIEW public.v_nombre_annonce_par_mois_par_annee OWNER TO your_username;

--
-- Name: v_nombre_vente_marque; Type: VIEW; Schema: public; Owner: your_username
--

CREATE VIEW public.v_nombre_vente_marque AS
 SELECT count(vma.id_annonce) AS nombre,
    m.id_marque,
    m.nom AS marque_nom,
    EXTRACT(year FROM vma.date_annonce) AS "extract"
   FROM (public.marque m
     JOIN public.v_modele_annonce vma ON (((m.id_marque)::text = (vma.id_marque)::text)))
  GROUP BY m.id_marque, m.nom, (EXTRACT(year FROM vma.date_annonce))
  ORDER BY (count(vma.id_annonce)) DESC;


